import React from "react";
import { BurgerMenu, Sidebar } from "react-developer-burger-ui-components";

const MyApp = () => {
  return (
    <div>
      <BurgerMenu>
        <Sidebar>
          <a href="/home">Home</a>
          <a href="/about">About</a>
          <a href="/contact">Contact</a>
        </Sidebar>
      </BurgerMenu>
      <div>
        <h1>Welcome to My App</h1>
        {/* Other content */}
      </div>
    </div>
  );
};

export default MyApp;
